43e\u043c\u0438 (\u0440\u043e\u0434)\">\u043a\u043b\u0430\u043d\u0430 \u0422\u043e\u0451\u0442\u043e\u043c\u0438<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_D%C5%8Dmy%C5%8Dji\" class=\"extiw\" title=\"en:Battle of D\u014dmy\u014dji\">\u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0414\u043e\u043c\u0438\u043e\u0434\u0436\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1621_%D0%B3%D0%BE%D0%B4\" title=\"1621 \u0433\u043e\u0434\">1621<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%92%D0%B5%D1%81%D1%82-%D0%98%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0412\u0435\u0441\u0442-\u0418\u043d\u0434\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0412\u0435\u0441\u0442-\u0418\u043d\u0434\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f<\/a>, \u043f\u043e\u043b\u0443\u0447\u0438\u0432\u0448\u0430\u044f \u043c\u043e\u043d\u043e\u043f\u043e\u043b\u044c\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e \u043d\u0430 \u043e\u0441\u0432\u043e\u0435\u043d\u0438\u0435 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0438 \u042e\u0436\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1784_%D0%B3%D0%BE%D0%B4\" title=\"1784 \u0433\u043e\u0434\">1784<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B0%D0%BF%D0%BE%D0%BB%D0%B8%D1%81_(%D0%9C%D1%8D%D1%80%D0%B8%D0%BB%D0%B5%D0%BD%D0%B4)\" title=\"\u0410\u043d\u043d\u0430\u043f\u043e\u043b\u0438\u0441 (\u041c\u044d\u0440\u0438\u043b\u0435\u043d\u0434)\">\u0410\u043d\u043d\u0430\u043f\u043e\u043b\u0438\u0441<\/a> (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8D%D1%80%D0%B8%D0%BB%D0%B5%D0%BD%D0%B4\" title=\"\u041c\u044d\u0440\u0438\u043b\u0435\u043d\u0434\">\u041c\u044d\u0440\u0438\u043b\u0435\u043d\u0434<\/a>) \u043f\u0435\u0440\u0435\u0441\u0442\u0430\u043b \u0431\u044b\u0442\u044c \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1785_%D0%B3%D0%BE%D0%B4\" title=\"1785 \u0433\u043e\u0434\">1785<\/a> \u2014 \u0444\u0440\u0430\u043d\u0446\u0443\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B0%D0%BD%D1%88%D0%B0%D1%80,_%D0%96%D0%B0%D0%BD-%D0%9F%D1%8C%D0%B5%D1%80_%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0\" title=\"\u0411\u043b\u0430\u043d\u0448\u0430\u0440, \u0416\u0430\u043d-\u041f\u044c\u0435\u0440 \u0424\u0440\u0430\u043d\u0441\u0443\u0430\">\u0424\u0440\u0430\u043d\u0441\u0443\u0430 \u0411\u043b\u0430\u043d\u0448\u0430\u0440<\/a> \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u0432 \u041b\u043e\u043d\u0434\u043e\u043d\u0435 \u0441\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u0438\u043c \u043f\u0430\u0440\u0430\u0448\u044e\u0442 \u0434\u043b\u044f \u043f\u0440\u044b\u0436\u043a\u043e\u0432 \u0441 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0433\u043e \u0448\u0430\u0440\u0430, \u0441\u043a\u0438\u043d\u0443\u0432 \u0432 \u043d\u0451\u043c \u0441\u043e\u0431\u0430\u043a\u0443 \u0441 \u0432\u044b\u0441\u043e\u0442\u044b 300 \u043c\u0435\u0442\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D0%BA%D0%B5%D0%BD%D0%B7%D0%B8,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_(%D0%BF%D1%83%D1%82%D0%B5%D1%88%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B8%D0%BA)\" title=\"\u041c\u0430\u043a\u043a\u0435\u043d\u0437\u0438, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 (\u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a)\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041c\u0430\u043a\u043a\u0435\u043d\u0437\u0438<\/a> (Alexander Mackenzie) \u043e\u0442\u043a\u0440\u044b\u043b \u0440\u0435\u043a\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D0%BA%D0%B5%D0%BD%D0%B7%D0%B8_(%D1%80%D0%B5%D0%BA%D0%B0)\" title=\"\u041c\u0430\u043a\u043a\u0435\u043d\u0437\u0438 (\u0440\u0435\u043a\u0430)\">\u041c\u0430\u043a\u043a\u0435\u043d\u0437\u0438<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0435<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830_%D0%B3%D0%BE%D0%B4\" title=\"1830 \u0433\u043e\u0434\">1830<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D1%83%D0%BC%D0%BD%D0%BE%D0%B9_%D0%B1%D1%83%D0%BD%D1%82_%D0%B2_%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D0%B5_(1830)\" title=\"\u0427\u0443\u043c\u043d\u043e\u0439 \u0431\u0443\u043d\u0442 \u0432 \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u0435 (1830)\">\u0447\u0443\u043c\u043d\u043e\u0439 \u0431\u0443\u043d\u0442 \u0432 \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1837_%D0%B3%D0%BE%D0%B4\" title=\"1837 \u0433\u043e\u0434\">1837<\/a>&#160;\u2014 \u043f\u043e\u0434 \u041b\u043e\u043d\u0434\u043e\u043d\u043e\u043c \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BF%D0%BF%D0%BE%D0%B4%D1%80%D0%BE%D0%BC\" title=\"\u0418\u043f\u043f\u043e\u0434\u0440\u043e\u043c\">\u0438\u043f\u043f\u043e\u0434\u0440\u043e\u043c<\/a> \u0434\u043b\u044f \u0433\u043e\u043d\u043e\u043a \u0441 \u043f\u0440\u0435\u043f\u044f\u0442\u0441\u0442\u0432\u0438\u044f\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1846_%D0%B3%D0%BE%D0%B4\" title=\"1846 \u0433\u043e\u0434\">1846<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043e\u0442\u0432\u043e\u0435\u0432\u0430\u043b\u0438 \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\">\u041c\u0435\u043a\u0441\u0438\u043a\u0438<\/a> \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0438\u0435 \u0419\u0435\u0440\u0431\u0430-\u0411\u0443\u044d\u043d\u0430. \u0412 \u044f\u043d\u0432\u0430\u0440\u0435 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0433\u043e \u0433\u043e\u0434\u0430 \u043e\u043d\u043e \u0431\u044b\u043b\u043e \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD-%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%81%D0%BA%D0%BE\" title=\"\u0421\u0430\u043d-\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u043e\">\u0421\u0430\u043d-\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869_%D0%B3%D0%BE%D0%B4\" title=\"1869 \u0433\u043e\u0434\">1869<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442\u043e \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%