3e\u0440\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u0439<\/a> \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u043b \u0420\u043e\u0441\u0441\u0438\u0438 \u0441\u0442\u0440\u043e\u0438\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%BE-%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u043e-\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u043e-\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0443\u044e \u0436\u0435\u043b\u0435\u0437\u043d\u0443\u044e \u0434\u043e\u0440\u043e\u0433\u0443<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b \u043c\u0438\u0440\u043d\u043e\u0439 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0432\u043e \u0432\u0440\u0435\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%BE-%D0%92%D0%BE%D0%B7%D0%BD%D0%B5%D1%81%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D1%82%D0%B0%D1%87%D0%BA%D0%B8\" title=\"\u0418\u0432\u0430\u043d\u043e\u0432\u043e-\u0412\u043e\u0437\u043d\u0435\u0441\u0435\u043d\u0441\u043a\u0438\u0435 \u0441\u0442\u0430\u0447\u043a\u0438\">\u0441\u0442\u0430\u0447\u043a\u0438<\/a> \u043d\u0430 \u0440\u0435\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BB%D0%BA%D0%B0_(%D0%BF%D1%80%D0%B8%D1%82%D0%BE%D0%BA_%D0%A3%D0%B2%D0%BE%D0%B4%D0%B8)\" title=\"\u0422\u0430\u043b\u043a\u0430 (\u043f\u0440\u0438\u0442\u043e\u043a \u0423\u0432\u043e\u0434\u0438)\">\u0422\u0430\u043b\u043a\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%BE\" title=\"\u0418\u0432\u0430\u043d\u043e\u0432\u043e\">\u0418\u0432\u0430\u043d\u043e\u0432\u043e-\u0412\u043e\u0437\u043d\u0435\u0441\u0435\u043d\u0441\u043a\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a>&#160;\u2014 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c<\/a>. \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D0%B5%D1%82%D0%B0_1&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u0435\u0442\u0430 1 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0411\u0435\u0442\u0430 1<\/a>\u00bb&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u043c\u044f\u0433\u043a\u0438\u0439 \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c, \u043f\u0440\u0438\u0447\u0430\u043b\u0438\u0432\u0448\u0438\u0439 \u043a \u043f\u0440\u0438\u0447\u0430\u043b\u044c\u043d\u043e\u0439 \u043c\u0430\u0447\u0442\u0435 \u0438 \u043f\u0435\u0440\u0432\u044b\u0439 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c \u0441 \u0431\u0435\u0441\u043f\u0440\u043e\u0432\u043e\u043b\u043e\u0447\u043d\u044b\u043c \u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u043e\u043c \u043d\u0430 \u0431\u043e\u0440\u0442\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/I_%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D1%8A%D0%B5%D0%B7%D0%B4_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D0%BE%D0%B2_%D1%80%D0%B0%D0%B1%D0%BE%D1%87%D0%B8%D1%85_%D0%B8_%D1%81%D0%BE%D0%BB%D0%B4%D0%B0%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%B4%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82%D0%BE%D0%B2\" title=\"I \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0441\u044a\u0435\u0437\u0434 \u0421\u043e\u0432\u0435\u0442\u043e\u0432 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0438 \u0441\u043e\u043b\u0434\u0430\u0442\u0441\u043a\u0438\u0445 \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432\">I \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0441\u044a\u0435\u0437\u0434 \u0421\u043e\u0432\u0435\u0442\u043e\u0432 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0438 \u0441\u043e\u043b\u0434\u0430\u0442\u0441\u043a\u0438\u0445 \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c \u0438\u0437\u0434\u0430\u043b \u0434\u0435\u043a\u0440\u0435\u0442 \u00ab\u041e \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438 \u0422\u0440\u0435\u0442\u044c\u044f\u043a\u043e\u0432\u0441\u043a\u043e\u0439 \u0433\u0430\u043b\u0435\u0440\u0435\u0438\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u0441\u043d\u0435\u0441\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D1%80%D0%BE%D1%82%D0%B0\" title=\"\u041a\u0440\u0430\u0441\u043d\u044b\u0435 \u0432\u043e\u0440\u043e\u0442\u0430\">\u041a\u0440\u0430\u0441\u043d\u044b\u0435 \u0432\u043e\u0440\u043e\u0442\u0430<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u0438<\/a> \u043f\u0440\u0438\u043d\u044f\u0442\u0430 \u043d\u043e\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%93%D1%80%D0%B5%D1%86%D0%B8%D0%B8\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u0413\u0440\u0435\u0446\u0438\u0438\">\u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B3%D0%B0\" title=\"\u041f\u0440\u0430\u0433\u0430\">\u041f\u0440\u0430\u0433\u0435<\/a>, \u0432\u043e \u0434\u0432\u043e\u0440\u0446\u0435 \u00ab\u0420\u0430\u0434\u0438\u043e\u00bb, \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u0432\u0435\u0447\u0435\u0440, \u043f\u043e\u0441\u0432\u044f\u0449\u0451\u043d\u043d\u044b\u0439 \u043f\u0430\u043c\u044f\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%8F%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u044f\u043a\u043e\u0432\u0441\u043a\u0438\u0439, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412. \u041c\u0430\u044f\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0441\u044f \u043f\u0435\u043d\u0438\u0435\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%82%D0%B5%D1%80%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB_(%D0%B3%D0%B8%D0%BC%D0%BD)\" title=\"\u0418\u043d\u0442\u0435\u0440\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b (\u0433\u0438\u043c\u043d)\">\u0418\u043d\u0442\u0435\u0440\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0430<\/a>\u00bb \u0438 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0435\u0439 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%86%D0%BB%D0%B0%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C\" title=\"\u0412\u0430\u0446\u043b\u0430\u0432\u0441\u043a\u0430\u044f \u043f\u043b\u043e\u0449\u0430\u0434\u044c\">\u0412\u0430\u0446\u043b\u0430\u0432\u0441\u043a\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1931_%D0%B3%D0%BE%D0%B4\" title=\"1931 \u0433\u043e\u0434\">1931<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0442\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8-%D0%B1%D0%B8-%D1%81%D0%B8\" title=\"\u0411\u0438-\u0431\u0438-\u0441\u0438\">\u0411\u0438-\u0431\u0438-\u0441\u0438<\/a> \u043f\u0440\u043e\u0432\u0435\u043b\u043e \u043f\u0440\u044f\u043c\u0443\u044e \u0442\u0440\u0430\u043d\u0441\u043b\u044f\u0446\u0438\u044e \u0444\u0438\u043d\u0430\u043b\u044c\u043d\u044b\u0445 \u0437\u0430\u0435\u0437\u0434\u043e\u0432 \u0441\u043e \u0441\u043a\u0430\u0447\u0435\u043a \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%80%D0%B1%D0%B8_(%D0%BA%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D1%81%D0%BF%D0%BE%D1%80%D1%82)\" title=\"\u0414\u0435\u0440\u0431\u0438 (\u043a\u043e\u043d\u043d\u044b\u0439 \u0441\u043f\u043e\u0440\u0442)\">\u0414\u0435\u0440\u0431\u0438<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D1%85%D1%81%D1%82%D0%B0%D0%B3_(%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F)\" title=\"\u0420\u0435\u0439\u0445\u0441\u0442\u0430\u0433 (\u0413\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f)\">\u0420\u0435\u0439\u0445\u0441\u0442\u0430\u0433<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u043f\u0440\u0438\u043d\u044f\u043b \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0438\u0437\u044a\u044f\u0442\u044c \u0432\u0441\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u00ab\u0434\u0435\u0433\u0435\u043d\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430\u00bb (\u0430\u0431\u0441\u0442\u0440\u0430\u043a\u0446\u0438\u043e\u043d\u0438\u0441\u0442\u043e\u0432, \u0438\u043c\u043f\u0440\u0435\u0441\u0441\u0438\u043e\u043d\u0438\u0441\u0442\u043e\u0432 \u0438&#160;\u0442.&#160;\u0434.).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u0438\u0437 \u0440\u0435\u0448\u0435\u043d\u0438\u044f \u041f\u043e\u043b\u0438\u0442\u0431\u044e\u0440\u043e \u0426\u041a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u0412\u041a\u041f(\u0431)<\/a> 3 \u0438\u044e\u043d\u044f 1941: \u00ab\u0420\u0430\u0437\u0440\u0435\u0448\u0438\u0442\u044c \u041d\u0430\u0440\u043a\u043e\u043c\u0432\u043d\u0435\u0448\u0442\u043e\u0440\u0433\u0443 \u0438\u0437 \u043e\u0441\u043e\u0431\u044b\u0445 \u0437\u0430\u043f\u0430\u0441\u043e\u0432 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0441\u0442\u0438 \u043f\u043e\u0441\u0442\u0430\u0432\u043a\u0443 \u0432 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044e \u0432\u043e \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430: \u043c\u0435\u0434\u0438 6000 \u0442\u043e\u043d\u043d, \u043d\u0438\u043a\u0435\u043b\u044f 1500 \u0442\u043e\u043d\u043d, \u043e\u043b\u043e\u0432\u0430 500 \u0442\u043e\u043d\u043d\u2026\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D1%8F\" title=\"\u0412\u0435\u043d\u0433\u0440\u0438\u044f\">\u0412\u0435\u043d\u0433\u0440\u0438\u0438<\/a> \u0432\u044b\u043f\u0443\u0449\u0435\u043d\u044b \u0431\u0430\u043d\u043a\u043d\u043e\u0442\u044b \u043d\u0430 \u0441\u0443\u043c\u043c\u0443 \u043c\u0438\u043b\u043b\u0438\u0430\u0440\u0434 \u043c\u0438\u043b\u043f\u0435\u043d\u0433\u0435 (\u043c\u0438\u043b\u043b\u0438\u0430\u0440\u0434 \u043c\u0438\u043b\u043b\u0438\u0430\u0440\u0434\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B3%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B5%D0%BD%D0%B3%D1%91\" title=\"\u0412\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u0438\u0439 \u043f\u0435\u043d\u0433\u0451\">\u043f\u0435\u043d\u0433\u0451<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0433\u0438\u043c\u0430\u043b\u0430\u0439\u0441\u043a\u0430\u044f \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f, \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u0435\u043c\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%80%D1%86%D0%BE%D0%B3,_%D0%9C%D0%BE%D1%80%D0%B8%D1%81\" title=\"\u042d\u0440\u0446\u043e\u0433, \u041c\u043e\u0440\u0438\u0441\">\u041c\u043e\u0440\u0438\u0441\u043e\u043c \u042d\u0440\u0446\u043e\u0433\u043e\u043c<\/a>, \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u043e\u043a\u043e\u0440\u0438\u043b\u0430 \u0433\u043e\u0440\u043d\u0443\u044e \u0432\u0435\u0440\u0448\u0438\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%8C%D0%BC%D0%B8%D1%82%D1%8B%D1%81%D1%8F%D1%87%D0%BD%D0%B8%D0%BA%D0%B8\" title=\"\u0412\u043e\u0441\u044c\u043c\u0438\u0442\u044b\u0441\u044f\u0447\u043d\u0438\u043a\u0438\">\u0432\u044b\u0441\u043e\u0442\u043e\u0439 \u0431\u043e\u043b\u0435\u0435 8000 \u043c\u0435\u0442\u0440\u043e\u0432<\/a>. \u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B0%D0%BF%D1%83%D1%80%D0%BD%D0%B0\" title=\"\u0410\u043d\u043d\u0430\u043f\u0443\u0440\u043d\u0430\">\u0410\u043d\u043d\u0430\u043f\u0443\u0440\u043d\u0443 I<\/a> \u0432\u0437\u043e\u0448\u043b\u0438 \u042d\u0440\u0446\u043e\u0433 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%88%D0%B5%D0%BD%D0%B0%D0%BB%D1%8C,_%D0%9B%D1%83%D0%B8\" title=\"\u041b\u0430\u0448\u0435\u043d\u0430\u043b\u044c, \u041b\u0443\u0438\">\u041b\u0443\u0438 \u041b\u0430\u0448\u0435\u043d\u0430\u043b\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%81%D1%82%D1%8B%D0%BD%D1%8F_%D0%A1%D0%B0%D1%85%D0%B0%D1%80%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u0443\u0441\u0442\u044b\u043d\u044f \u0421\u0430\u0445\u0430\u0440\u0430\">\u0421\u0430\u0445\u0430\u0440\u0435<\/a> \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0430 \u0433\u0440\u043e\u0431\u043d\u0438\u0446\u0430 \u0434\u0440\u0435\u0432\u043d\u0435\u0435\u0433\u0438\u043f\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0444\u0430\u0440\u0430\u043e\u043d\u0430 \u0421\u0430\u043d\u0445\u0435\u0442\u0430 (\u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=2570_%D0%B3%D0%BE%D0%B4_%D0%B4%D0%BE_%D0%BD._%D1%8D.&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"2570 \u0433\u043e\u0434 \u0434\u043e \u043d. \u044d. (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">2570 \u0433\u043e\u0434 \u0434\u043e \u043d. \u044d.<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BD%D0%B3%D0%B0%D0%BF%D1%83%D1%80\" title=\"\u0421\u0438\u043d\u0433\u0430\u043f\u0443\u0440\">\u0421\u0438\u043d\u0433\u0430\u043f\u0443\u0440<\/a> \u043f\u0440\u0438\u043d\u044f\u043b \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e \u0438 \u0441\u0442\u0430\u043b \u0441\u0430\u043c\u043e\u0443\u043f\u0440\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u043c\u0441\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e \u0434\u0432\u0443\u0445\u0434\u043d\u0435\u0432\u043